function ProfileCard({handle,title,image,description}){
    return (
        <div className="card">
            <div className="card-image">
                <figure className="image is-1by1">
                <img src={image} alt="pdas image"/>
                </figure>
            </div>
            <div className="card-content">
                <div className="media">

                    <p className="title is-4">the title is {title}</p>
                    <p className="title is-6">the handle is {handle}</p>
                </div>
            </div>
            <div className="content">
                {description}
            </div>
        </div>
    );
}
export default ProfileCard;
